import './App.css';

import Logo from './componentes/template/Logo';
import Menu from './componentes/template/Menu';
import Main from './componentes/template/Main';
import Footer from './componentes/template/Footer';

function App() {
  return (
    <div className="App">
      <Logo />
      <Menu />
      <Main title="Seja bem vindo">
        <div>Vos apresento meu site feito em ReactJS que
             contém minha uma coleção com diversos Sneakers e colecionadores.</div>
      </Main>
      <Footer />
    </div>
  );
}

export default App;
